import { useEffect, useState } from 'react'
import getMovieVideo from '../../services/getMovieVideo'

export function useMovieVideo(id) {
    const [parameter, setParameter] = useState('')


    useEffect(() => {   
        getMovieVideo({ id })
            .then(elements => {
              setTimeout(()=>setParameter(elements),2000)
            }) 
    }, [id]) 


    return parameter

}
